import { Injectable } from '@angular/core'
import { Skill } from '../../models/profile'

@Injectable({
  providedIn: 'root'
})
export class SkillService {

  constructor() { }

  skills: Skill[] = [
    {
      key: 'csharp',
      name: 'C#',
      ico: ''
    },
    {
      key: 'nodejs',
      name: 'NodeJS',
      ico: ''
    }
  ]

  getSkill(key: string): Promise<Skill | undefined> {
    return Promise.resolve(this.skills.find(x => x.key === key))
  }

  getSkills(): Promise<Skill[]> {
    return Promise.resolve(this.skills)
  }
}
